import Icons from "./Global/Icons";
export default function MobileFooter(){
    return(
        <div class="fundo-mobile">
            <Icons name="home" />
            <Icons name="search-outline" />
            <Icons name="add-circle-outline" />
            <Icons name="heart-outline" />
            <Icons name="person-outline" />
        </div>
    )
}
